        public override void Initialize()
        {
            downedCrystil = false;
            VoidBiome = false;
            VoidOre = false;
            EarthenOre = false;
            GlacialOre = false;
            CosmoOre = false;
            LuminiteOre = false;
            SolariumOre = false;
            TechnoOre = false;
            SwarmUp = false;
            LihzahrdOre = false;
            GalactiteOre = false;
            Main.invasionSize = 0;
            downedRockMonarch = false;
            downedSerpent = false;
            downedToxicFrog = false;
            downedIceFish = false;
            downedCloud = false;
            downedDragon = false;
            downedDragonFly = false;
            downedQueenAnt = false;
            downedVoidSnake = false;
            downedTheVirus = false;
            downedGalacticGuardian = false;
            SwarmKilled = false;

            MentalMode = false;

