        public override void PostWorldGen()
        {
            int[] itemsToPlaceInAntChests = { mod.ItemType("AntWings"), mod.ItemType("Nunchucks"), mod.ItemType("FishSprayer"), mod.ItemType("MarshmallowRifle"), mod.ItemType("SnailFlail") };
            int[] itemsToPlaceInVoidChests = { mod.ItemType("VoidedOrbs"), mod.ItemType("VoidedKnives"), mod.ItemType("VoidBlade"), mod.ItemType("VoidedBow") };
            int[] itemsToPlaceInAshenChests = { mod.ItemType("FlamingKnives"), mod.ItemType("FireStaff"), mod.ItemType("HellThrow"), mod.ItemType("FireVolley"), mod.ItemType("FireShuriken"), mod.ItemType("FlameSceptre"), mod.ItemType("FlamingAnchor"), mod.ItemType("FlyingFireKnife"), ItemID.ObsidianRose, ItemID.ObsidianSkull, ItemID.LavaWaders };
            foreach (Chest chest in Main.chest.Where(c => c != null))
            {

                var tile = Main.tile[chest.x, chest.y];
                if (tile.type == mod.TileType("AntsChest"))
                {
                    int item = 0;
                    chest.item[item].SetDefaults(Main.rand.Next(itemsToPlaceInAntChests));
                    item++;
                    chest.item[item].SetDefaults(mod.ItemType("EarthenBar"));
                    chest.item[item].stack = Main.rand.Next(25, 35);
                    item++;
                    chest.item[item].SetDefaults(mod.ItemType("ElementalJaw"));
                    chest.item[item].stack = Main.rand.Next(5, 35);
                    item++;
                    chest.item[item].SetDefaults(ItemID.GoldCoin);
                    chest.item[item].stack = Main.rand.Next(5, 35);
                    item++;
                    chest.item[item].SetDefaults(ItemID.GreaterHealingPotion);
                    chest.item[item].stack = Main.rand.Next(5, 35);
                }
                else if (tile.type == mod.TileType("VoidChest"))
                {
                    int item = 0;
                    chest.item[item].SetDefaults(Main.rand.Next(itemsToPlaceInVoidChests));
                    item++;
                    chest.item[item].SetDefaults(ItemID.GoldCoin);
                    chest.item[item].stack = Main.rand.Next(10, 40);
                    item++;
                    chest.item[item].SetDefaults(ItemID.GreaterHealingPotion);
                    chest.item[item].stack = Main.rand.Next(5, 35);
                }
                else if (tile.type == mod.TileType("ShadowContainer"))
                {
                    int item = 0;
                    chest.item[item].SetDefaults(mod.ItemType("ShadeCrystal"));
                    chest.item[item].stack = Main.rand.Next(1, 3);
                    item++;
                    chest.item[item].SetDefaults(mod.ItemType("ShadowBar"));
                    chest.item[item].stack = Main.rand.Next(5, 25);
                    item++;
                    chest.item[item].SetDefaults(mod.ItemType("ShadowGem"));
                    chest.item[item].stack = Main.rand.Next(5, 15);
                    item++;
                    chest.item[item].SetDefaults(ItemID.GoldCoin);
                    chest.item[item].stack = Main.rand.Next(5, 20);
                    item++;
                    chest.item[item].SetDefaults(ItemID.HealingPotion);
                    chest.item[item].stack = Main.rand.Next(15, 35);
                }
                else if (tile.type == mod.TileType("AshenChest"))
                {
                    List<int> items1 = new List<int>();
                    for (int i = 0; i < Main.rand.Next(1, 4); i++)
                    {
                        bool itemIn = false;
                        while (itemIn == false)
                        {
                            int itemId = Main.rand.Next(itemsToPlaceInAshenChests);
                            if (!items1.Contains(itemId))
                            {
                                itemIn = true;
                                items1.Add(itemId);
                            }
                        }
                    }
                    int itemIndex = 0;
                    foreach (int item in items1)
                    {
                        chest.item[itemIndex].SetDefaults(item);
                        itemIndex++;
                    }
                    chest.item[itemIndex].SetDefaults(ItemID.Hellstone);
                    chest.item[itemIndex].stack = Main.rand.Next(5, 20);
                    itemIndex++;
                    chest.item[itemIndex].SetDefaults(ItemID.Obsidian);
                    chest.item[itemIndex].stack = Main.rand.Next(5, 20);
                    itemIndex++;
                    chest.item[itemIndex].SetDefaults(ItemID.GoldCoin);
                    chest.item[itemIndex].stack = Main.rand.Next(5, 20);
                    itemIndex++;
                    chest.item[itemIndex].SetDefaults(ItemID.HealingPotion);
                    chest.item[itemIndex].stack = Main.rand.Next(15, 35);

                }
            }
        }
        public static int[] GetAntTypes()
        {
            Mod mod = ModLoader.GetMod("DRGN");
            List<int> Types = new List<int>();
            Types.Add(mod.NPCType("Ant"));
            Types.Add(mod.NPCType("ElectricAnt"));
            Types.Add(mod.NPCType("FireAnt"));
            if (downedToxicFrog) { Types.Add(mod.NPCType("ToxicAnt")); Types.Add(mod.NPCType("SnakobHead")); }
            if (downedIceFish) { Types.Add(mod.NPCType("GlacialAnt")); Types.Add(mod.NPCType("GlacialCrawlerHead")); }
            if (NPC.downedMoonlord) { Types.Add(mod.NPCType("LunarAnt")); Types.Add(mod.NPCType("AntCrawlerHead")); }
            if (downedDragon) { Types.Add(mod.NPCType("MagmaticAnt")); Types.Add(mod.NPCType("MagmaticCrawlerHead")); Types.Add(mod.NPCType("MegaMagmaticCrawlerHead")); }
            if (downedVoidSnake) { Types.Add(mod.NPCType("VoidCrawlerHead")); }
            return Types.ToArray();
        }

        public override void PostUpdate()
        {
            if (!NPC.AnyNPCs(mod.NPCType("FireDragon")))
            {
                for (int i = 0; i < 255; i++)
                {
                    if (Main.player[i].active && Main.player[i].GetModPlayer<DRGNPlayer>().DragonBiome && Main.rand.NextBool(1, MentalMode ? 60 : Main.expertMode ? 90 : 120))
                    {
                        if (Main.netMode != NetmodeID.MultiplayerClient)
                        {
                            int projid = Projectile.NewProjectile(new Vector2(Main.player[i].Center.X + Main.rand.Next(-600, 600), Main.maxTilesY * 16 - 100), new Vector2(0, -10), mod.ProjectileType("DragonFireballProjHostile"), MentalMode ? 40 : 15, 1f);
                            NetMessage.SendData(MessageID.SyncProjectile, -1, -1, null, projid);
                        }
                    }
                }
            }
            if (SwarmUp)
            {
                if (Main.invasionX == (double)Main.spawnTileX)
                {
                    //Checks progress and reports progress only if invasion at spawn
                    Swarm.CheckSwarmProgress();
                }
                //Updates the custom invasion while it heads to spawn point and ends it
                Swarm.UpdateSwarm();
            }

        }
        public static int isVoidBiome = 0;
        public static int isAntBiome = 0;
        public static int DragonDen = 0;

        public override void TileCountsAvailable(int[] tileCounts)
        {
            DragonDen = tileCounts[mod.TileType("DragonBrick")];
            isVoidBiome = tileCounts[mod.TileType("VoidBrickTile")];
            isAntBiome = tileCounts[mod.TileType("AntsNest")];
        }

        public override void PreUpdate()
        {
            FlamingTreeFrame += 0.1f;
            if (FlamingTreeFrame > 2.49) { FlamingTreeFrame = 0; }
            if (!Main.dayTime && NPC.downedMoonlord)
            {
                if (starStorm && Main.rand.Next(0, 20) == 1) { Projectile.NewProjectile(new Vector2(Main.rand.Next(0, Main.maxTilesX * 16), 0), new Vector2(Main.rand.NextFloat(-2, 2), Main.rand.Next(1, 5)), mod.ProjectileType("LunarStar"), 5000, 0f, 0); }
                else if (Main.rand.Next(0, 1000) == 1) { Projectile.NewProjectile(new Vector2(Main.rand.Next(0, Main.maxTilesX * 16), 0), new Vector2(Main.rand.NextFloat(-2, 2), Main.rand.Next(1, 5)), mod.ProjectileType("LunarStar"), 5000, 0f, 0); }
            }
            if (starStorm && Main.rand.Next(0, 20) == 1) { Projectile.NewProjectile(new Vector2(Main.rand.Next(0, Main.maxTilesX * 16), 0), new Vector2(Main.rand.NextFloat(-2, 2), Main.rand.Next(20, 50)), ProjectileID.FallingStar, 1000, 0f, 0); }

            if (!Main.dayTime && Main.time == 0.0 && Main.rand.Next(0, 10) == 1) { Main.NewText("The sky is filled with stars", 200, 20, 200); starStorm = true; }

            if (starStorm && Main.dayTime) { starStorm = false; }

            

        }

    }
